/*Table structure for table `fx` */

DROP TABLE IF EXISTS `fx`;

CREATE TABLE `fx` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `FXCode` varchar(6) NOT NULL COMMENT 'USD',
  `FXSymbol` varchar(100) DEFAULT NULL COMMENT '$',
  `FxName` varchar(100) DEFAULT NULL COMMENT 'US Dollar',
  `IsBase` tinyint(1) DEFAULT NULL COMMENT '(if True, RateToBase is automatically set to 1)',
  `RateToBase` decimal(20,8) DEFAULT NULL COMMENT 'Exchange rate to base',
  `IsActive` tinyint(1) DEFAULT '1',
  `IsDelete` tinyint(1) DEFAULT NULL COMMENT 'soft delete flag',
  `DeletedBy` int(10) DEFAULT NULL COMMENT 'activity audit trail capture',
  `DeletedOn` datetime DEFAULT NULL COMMENT 'activity audit trail capture',
  `CreatedBy` int(10) DEFAULT NULL COMMENT 'activity audit trail capture',
  `CreatedOn` datetime DEFAULT NULL COMMENT 'activity audit trail capture',
  `ModifiedBy` int(10) DEFAULT NULL COMMENT 'activity audit trail capture',
  `ModifiedOn` datetime DEFAULT NULL COMMENT 'activity audit trail capture',
  PRIMARY KEY (`id`),
  UNIQUE KEY `IndexFXCode` (`FXCode`),
  KEY `FK_fx` (`DeletedBy`),
  KEY `FK_fx1` (`CreatedBy`),
  KEY `FK_fx2` (`ModifiedBy`),
  CONSTRAINT `FK_fx` FOREIGN KEY (`DeletedBy`) REFERENCES `user` (`user_id`),
  CONSTRAINT `FK_fx1` FOREIGN KEY (`CreatedBy`) REFERENCES `user` (`user_id`),
  CONSTRAINT `FK_fx2` FOREIGN KEY (`ModifiedBy`) REFERENCES `user` (`user_id`)
